import React from 'react';
import { BiListCheck, BiTask } from 'react-icons/bi';
import { AiOutlineUsergroupAdd } from 'react-icons/ai';
import { MdLocalGroceryStore } from 'react-icons/md';
import { FiUser } from 'react-icons/fi';
import { Link } from 'react-router-dom';
import Container from '../../components/Container';
import { Content } from './styles';
import FloatMenu, { FloatMenuItem } from '../../components/FloatMenu';
import { MenuItem } from '../../components/FloatMenu/styles';

const Register: React.FC = () => {
  return (
    <Container>
      <Content>
        <FloatMenu>
          <FloatMenuItem icon={BiListCheck} name="Tarefas" url="/teste" />
        </FloatMenu>
        <Link to="user-register">
          <FiUser size={35} />
          <strong>Cadastro Usuários</strong>
        </Link>
        <Link to="group-user-register">
          <AiOutlineUsergroupAdd size={35} />
          <strong>Cadastro Grupo Usuários</strong>
        </Link>
        <Link to="group-user-register">
          <MdLocalGroceryStore size={35} />
          <strong>Cadastro Produtos</strong>
        </Link>
      </Content>
    </Container>
  );
};

export default Register;
